import React, { Fragment } from "react";
//import { Link } from "react-router-dom";

import "./Popup.scss";

class Popup extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      value: "",
      redirect: false,
      items: []
    };
  }

  maFonction() {
    console.log("je suis là");
  }

  render() {
    // let ConditionalLink = this.state.value ? Link : Fragment;
    return (
      <Fragment>
        <div className="mask">
          <div className="popup">
            <form className="form">
              <input
                className="inputPopUp"
                type="text"
                placeholder="Recherchez un modèle"
                required
                onChange="maFonction"
              />
            </form>
          </div>
        </div>
      </Fragment>
    );
  }
}

export default Popup;
